export default function Contact() {
  return (
    <section className="py-16 bg-gray-900 text-white text-center">
      <h2 className="text-3xl font-bold mb-6">Contact Us</h2>
      <form className="max-w-xl mx-auto space-y-4">
        <input type="text" placeholder="Your Name" className="w-full p-3 rounded-lg text-black"/>
        <input type="email" placeholder="Your Email" className="w-full p-3 rounded-lg text-black"/>
        <textarea placeholder="Message" className="w-full p-3 rounded-lg text-black"></textarea>
        <button type="submit" className="px-6 py-3 bg-yellow-400 text-black font-semibold rounded-lg">
          Send Message
        </button>
      </form>
    </section>
  );
}
